import logo from './logo.svg';
import './App.css';
import { GoogleMap, useJsApiLoader} from '@react-google-maps/api'
import React from "react";
import LoadingSpinner from 'react-loading';

const options = {
  zoomControlOptions: {
    position: 'right-center',
    // ...otherOptions
  }
};

function App() {
  const { isLoaded, loadError } = useJsApiLoader({
    googleMapsApiKey: "YOUR_API_KEY" // Replace with your API key
    // ...otherOptions
  });

  const renderMap = () => {
    const onLoad = React.useCallback(function onLoad(mapInstance) {
      // do something with map Instance
    });

    return (
      <GoogleMap options={options} onLoad={onLoad}>
        {/* Your map components */}
      </GoogleMap>
    );
  };

  if (loadError) {
    return <div>Map cannot be loaded right now, sorry.</div>;
  }

  return isLoaded ? renderMap() : <LoadingSpinner />;
}


export default App;
